	constructor() {
		super()
		this.state = {
			fullScreen: false
		}
	}

	makeFullScreen = e => {
		e.target.requestFullScreen();
	}

	buildBoard() {
		return <FullScreen />
	}

	render() {
		let board = this.buildBoard();
	    return (<div className="Home">
	    	<HomeCard>
	    	</HomeCard>
	    </div>);
	}
}

export default Home;
